import React from 'react';

function About() {
  return (
    <section id="about" className="about">
      <h2>Welcome to my Portfolio</h2>
      <p className="aboutme">
      My name is Usman Tahir Qureshi and I am currently pursuing a Master's degree in Applied Computer Science. I am a full-stack developer with experience in mobile and web application development.
      </p>
      {/* Include your work description here */}
    </section>
  );
}

export default About;
